column8:
■　本製品で使用している糊はかなりデリケートなので、<BR>
保護フィルムを剥がして糊面に水を掛けずに再度保護フィルムを糊面につけますと、<BR>
糊に痕がついてしまいます。 
■ 炎天下での作業はお控えください。<BR>

■ 作業後の水は自然に抜けますが<BR>
（若干時間が掛かる場合があります）、<BR>
気泡は残りますのでご注意ください。<BR>

■ 車の塗装は紫外線などにより徐々に退色していきます。<BR>
本製品を貼ることにより紫外線から塗装を保護しますので、<BR>
施工部分とその他の場所で塗装の状態が異なる現象が生じる場合があります。<BR>

★剥がし方<BR>

接着剤に強力タイプを使用していますが、<BR>
剥がす時は糊残りが少なく剥がすことが出来ます。<BR>
剥がす前に全体をドライヤーなどで十分に暖めてゆっくり剥がしてください。<BR>
冬季の寒い時期や、一気に引っ張って剥がすと糊残りする場合がありますが、<BR>
指の腹で擦るようにしますと除去できます。<BR>
また貼ってある場所の塗装状態が悪い場合は塗装が剥がれる恐れがあります。<BR>


◆メーカー：VAPSn（XPEL製）<BR>
　エッジガード<BR>
　1.4cm（幅）×360（長さcm)　×1枚 <BR>
◆ 素材：ウレタン<BR>
（本体厚約１５０ミクロン　糊厚約５０ミクロン）<BR> 
＊パッケージは余儀なく変更する場合があります。　 


