■紫外線(UV)を99％以上カット<br>
　 お肌の大敵、紫外線を99％以上カットし、シミやシワ、日焼けを防ぎます。<br>
　 また、車内の内装やアクセサリーの色あせ、劣化を防ぎます。<br>
■お財布にやさしい！<br>
　 車内温度の上昇が抑えられ、エアコンを効率良く使えるようになるので燃費が改善します。<br>
　 また、UVクリームなど、紫外線対策グッズも不要になるので、お財布にダブルでやさしいフィルムです。<br>
■携帯電話やカーナビもOK<br>
　 電磁波をカットしないので、携帯電話、カーナビ、ETC、TVなどの使用にも影響をあたえません。<br>
■ガラス飛散防止対策にも<br>
　 万が一ガラスが割れた場合、ガラスの車内外への飛散を低減します。<br><br>
